import React,{useEffect, useState} from 'react'
import LogItem from './LogItem';
import LogSurvey from './LogSurvey';
import { connect } from 'react-redux';
import PropTypes from 'prop-types';
import {getLogs} from '../../actions/logActions';


 const Logs = ({log: {logs, loading}, getLogs}) => {
    //  const [logs, setLogs] = useState([]);
    //  const [loading, setLoading] = useState(false);
    //  const [techs, setTechs] = useState('');

     useEffect(() => {
         getLogs();
         //es-lint-disable-next-line
     }, [])



     if(loading || logs === null){
         return <h4>Loading...</h4>
     }

    return (
        <div className="container">
        <ul className="collection with-header">
            <li className="collection-header">

                    <div className="input-field">
                        <select name="tech" value={tech} className='browser-default' onChange={e => setTechs(e.target.value)}>
                            <option value='' disabled> 
                                Employee
                            </option>
                            <option value='john Doe'>john doe</option>
                            <option value='sam smith'>sam smith</option>
                            <option value='sara williams'>sara williams</option>
                        </select>
                    </div>

            </li>
            {!loading && logs.legth === 0 ? (<p className="center">No employees to show</p>) : (
                logs.map(log => <LogItem log={log} key={log.id} />)
            )}
        </ul>


        <ul className="collection with-header">
            <li className="collection-header">

                    <div className="input-field">
                        <select name="techs" value={techs} className='browser-default' onChange={e => setTechs(e.target.value)}>
                            <option value='' disabled> 
                                Assigned Employee
                            </option>
                            <option value='john Doe'>john doe</option>
                            <option value='sam smith'>sam smith</option>
                            <option value='sara williams'>sara williams</option>
                        </select>
                    </div>

            </li>
            {!loading && techs.legth === 0 ? (<p className="center">No employees to show</p>) : (
                logs.map(log => <LogSurvey log={log} key={log.id} />)
            )}
        </ul>
        </div>
    )
}

Logs.propTypes = {
    log: PropTypes.object.isRequired,
    getLogs: PropTypes.func.isRequired
}

const mapStateToProps = state => ({
    log: state.log
})


export default connect(mapStateToProps, {getLogs})(Logs);
